import React, { Component } from 'react'

export default class TopicApply extends Component {
  render() {
    return (
      <div>
        <div>
            <div><button onClick ={this.props.closeApply}>关闭</button></div>
            <div>课题名：{this.props.topicdata.topicname}</div>
            <div>开始时间：{this.props.topicdata.topicname}</div>
            <div>结束时间：{this.props.topicdata.topicname}</div>
            <div>招收人数：{this.props.topicdata.topicname}</div>
            <div>简介：{this.props.topicdata.topicname}</div>
            <div>要求：{this.props.topicdata.topicname}</div>
            <div></div>
        </div>
      </div>
    )
  }
}
